import { Component } from '@angular/core';

@Component({
  selector: 'app-inicio-sesion',
  templateUrl: './inicio-sesion.component.html',
  styleUrls: ['./inicio-sesion.component.css']
})
export class InicioSesionComponent {
  email: string;
  password: string;
  rememberMe: boolean = false;

  onSubmit() {
    // Handle form submission
    console.log('Email:', this.email);
    console.log('Password:', this.password);
    console.log('Remember Me:', this.rememberMe);
  }
}
<div class="form-container">
    <img src="assets/images/openenglish.png" alt="Logo"> 
    <h2>Welcome Student</h2>
    <form (ngSubmit)="onSubmit()">
        <input type="text" placeholder="Email" name="usuario" [(ngModel)]="email" required>
        <input type="password" placeholder="Password" name="contrasena" [(ngModel)]="password" required>
        <button type="submit">Log In</button>
        <div class="options">
            <label>
                <input type="checkbox" name="remember" [(ngModel)]="rememberMe"> Remember Me
            </label>
            <span>|</span> 
            <a href="#">Password Reset</a>
        </div>
    </form>
</div>
